window.bookSummaryJSON = "<p>She’s been held at gunpoint, stuck in a burning dumpster, chased out of a grocery store, caught impersonating a police officer, and almost run over by a wayward vehicle. How is that for a first day on the job as an amateur sleuth? Along with her friend, Annie Mae, Cat investigates the brick-paved, oak-lined streets of Savannah to find their friend’s murderer. To say the very least, it is not smooth sailing for these self-appointed detectives. Will they catch the killer before the killer gets them? Or will their first case be their last?</p> <p>Find out in the first volume of the Georgia Coast Cozy Mystery series, <i>Dying for Dinner Rolls</i>, which combines mystery, suspense, humor, and Southern charm.</p>"; 
